import React, { useState } from 'react'

const Index = () => {
    const [number,setnumber]=useState(0)
  return (
    <div>
        <input 
        type="number" 
        name="number" 
        id="number" 
        value={number} 
        onChange={(e)=>setnumber(Number(e.target.value))}
        /> <br/>
        <button>Change theme</button> 
    </div>
  )
}
export default Index;
